export default function Aff(props){
    return (
      <>
      <div>
        <img src={props.movie.poster_path} alt={props.movie.title} />
        <div className="card-body">
        <h6 className="card-title">{props.movie.title}</h6>
        <h5>{props.movie.media_type}</h5>
        </div>
        </div>
      </>
        
      )
}
